import sys

def solve(m):
    count = 0
    result = []
    n = 1
    while True:
        if count == m:
            result.append(n)
        elif count > m:
            break
        n += 1
        while n % 5 == 0:
            count += 1
            n //= 5
    return len(result), ' '.join(map(str, result))

m = int(input())
print(solve(m)[0])
print(solve(m)[1])
